# This function will download a single PDF file
def download_pdf(url, i):
    """Downloads a single PDF from a URL and saves it with its original filename."""
    try:
        # Parse the URL to get the path, and then extract the filename
        parsed_url = urlparse(url)
        filename = os.path.basename(parsed_url.path)

        # Check if a filename was actually found in the URL
        if not filename:
            filename = f"nameerror_{i}"

        print(f'Starting download for {filename} from {url}...')

        response = requests.get(url, timeout=30) # Add a timeout for the request
        response.raise_for_status()  # Raise an exception for bad status codes (4xx or 5xx)

        # Save the content to a file with the extracted name
        with open(filename, 'wb') as f:
            f.write(response.content)

        return f' Successfully downloaded {filename}'

    except requests.exceptions.RequestException as e:
        return f' Failed to download {url}. Error: {e}'

