    # Use a ThreadPoolExecutor to manage concurrent downloads
    # The 'with' statement ensures threads are cleaned up properly
    with concurrent.futures.ThreadPoolExecutor(max_workers=MAX_WORKERS) as executor:
        # Create a "future" for each download. This schedules it to run.
        # We use enumerate to get both the index and the url for naming files
        future_to_url = {executor.submit(download_pdf, url, i): url for i, url in enumerate(pdf_links)}
        
        # As each download completes, print its result
        for future in concurrent.futures.as_completed(future_to_url):
            try:
                result = future.result()
                print(result)
            except Exception as exc:
                print(f'A download generated an exception: {exc}')

    print("\nAll downloads complete!")